import Login from './pages/Login'

function App() {
  return (
    // <Router>
      <div>
        
        <div>
          <Routes>
            <Route exact path='/'><Login/></Route>
            {/* <Route exact path='/loginpage'><Login isLoggedIn={isLoggedIn}/></Route>
